    "featuredReviews": {
      "edges": [
        {
          "node": {
            "author": {
              "nickName": "VithDos",
              "__typename": "UserProfile"
            },
            "summary": {
              "originalText": "Surprisingly Well Done",
              "__typename": "ReviewSummary"
            },
            "text": {
              "originalText": {
                "plainText": "So the world premier of Iron man to regular movie going audiences happened to be here in Seoul Korea on an army installation. I got to check it out and I was delightfully surprised.\n\nMuch against the hype, I thought this movie would have been torrid trash acting mingled with cheesy fight scenes. I mean Robert Downey Jr as an action superhero? But I am glad to admit that I misjudged the movie completely. Downey played a very good Tony Stark, in generally every way. From his jokes to his obnoxious lifestyle he looked and walked the part very well. His banter with his right hand assistant Ms. Pepper Potts isn't mind numbing and actually found myself laughing aloud at some of the wit.\n\nThe movie itself moved at a very good pace. Mixing action, comedy and some drama to just about the right proportions. As with most superhero movies, its rather predictable, but in all the right ways you'd want a superhero movie to be. The animation used was almost seamless, and of course the Iron Man costume was kicking major ass.\n\nMy only gripe with the movie was the fact that several characters were thrown into the mix with little behind them other than 2D character attributes. Leslie Bibb's character, Christine Everhart, is pretty useless other than the two or three lines she has. Hardly worth a hardbody like Leslie Bibb to play. Several other characters didn't feel fleshed out at all. Raza (Faran Tahir), Obediah Stone (Jeff Bridges) , and even Jim Rhodes (Terrence Howard) feel hollow in the fact that they have little justification for many of their actions.\n\nSo All in all, I'd give this movie an 8.3. Fun for the whole family, great pacing, and a Superhero movie to give the next Batman movie a run for its money.",
                "__typename": "Markdown"
              },
              "__typename": "ReviewText"
            },
            "authorRating": 8,
            "submissionDate": "2008-04-17",
            "__typename": "Review"
          },
          "__typename": "ReviewEdge"
        }
      ],
      "__typename": "ReviewsConnection"
    },
