    "trivia": {
      "edges": [
        {
          "node": {
            "text": {
              "plaidHtml": "The script was not completely finished when filming began, since the filmmakers were more focused on the story and the action, so the dialogue was mostly ad-libbed throughout filming. Director \u003Ca class=\"ipc-md-link ipc-md-link--entity\" href=\"/name/nm0269463/?ref_=dyk_trv\"\u003EJon Favreau\u003C/a\u003E acknowledged this made the film feel more natural. For example, Tony&#39;s monologue while he demonstrates the &#39;Jericho&#39; in the desert to the troops in the beginning of the movie was conceived on the spot; \u003Ca class=\"ipc-md-link ipc-md-link--entity\" href=\"/name/nm0000375/?ref_=dyk_trv\"\u003ERobert Downey Jr.\u003C/a\u003E isn&#39;t just wearing sunglasses for protection from the bright sun, but also to hide the fact that he is reading his lines off of cue cards. Some scenes were shot with two cameras, to capture lines improvised on the spot. Downey would ask for many takes of one scene, since he wanted to try something new. \u003Ca class=\"ipc-md-link ipc-md-link--entity\" href=\"/name/nm0000569/?ref_=dyk_trv\"\u003EGwyneth Paltrow\u003C/a\u003E, on the other hand, had a difficult time trying to match Downey with a suitable line, as she never knew what he would say.",
              "__typename": "Markdown"
            },
            "trademark": null,
            "relatedNames": null,
            "__typename": "TitleTrivia"
          },
          "__typename": "TriviaEdge"
        }
      ],
      "__typename": "TriviaConnection"
    },
